window.bookSummaryJSON = "<p>Paleontologist Brandon Thackery and his rival, Miles \"Klicks\" Jordan, fulfill a dinosaur lover's dream with history's first time-travel jaunt to the late Mesozoic. Hoping to solve the extinction mystery, they find Earth's gravity is only half its 21st-century value and dinosaurs that behave very strangely. Could the slimy blue creatures from Mars have something to do with both? </p>"; 
